import Layout from '../components/layout/primaryLayout';
import Link from 'next/link';
import { sizing } from '@material-ui/system';
import { Grid, Typography, Button, Container } from '@material-ui/core';

const Home = () => {
	return (
		<Layout>
			<Grid container spacing={2}>
				<Grid item xs={12}>
					<Typography align="center">Call For Help</Typography>
				</Grid>
				<Grid item xs={12} sm={6} justify="flex-end">
					<Link passHref prefetch href="/ic">
						<Button fullWidth spacing={2} variant="contained" color="primary">IC</Button>
					</Link>
				</Grid>
				<Grid item xs={12} sm={6} justify="flex-start">
					<Link passHref prefetch href="/maintenance">
						<Button fullWidth variant="contained" color="primary">Maintenance</Button>
					</Link>
				</Grid>
			</Grid>
		</Layout>
	)
}

export default Home
